import "./plans.css"
import {PlansData} from "../data/PlansData";
// import check from "../../assets/img/check.svg";


function Plans() {
  return (
      <div className="plans-container">
          
              <div className="plans-headr" style={ {gap:"2rem"} }>
                  <span className='stroke-text'>ready to start</span>
                  <span> your jurny</span>
                  <span className='stroke-text' > now with us </span>
              </div>
          

          <div className="plans">
              {PlansData.map( (pln , i) => (
                  <div className="plansBox" key={i}>
                      {pln.icon}
                      <span> {pln.name} </span>
                      <span>  ${pln.price}</span>
              
                      <div className="featuers">
                          {pln.featuers.map((feat, i) => (
                      
                              <div className="feat">
                                  {icon}
                                  {/* <img src={check} style={{ gap: "1.5rem" } } /> */}
                                  <span key={i}>{featuers}</span>
                              </div>
                          ))}
                         
                     </div>
                   </div>
              ))}  

         </div>
              

          <span>see more featuers</span>
          <button>join now</button>


          </div>
          
  )
}

export default Plans
